query:
/*+ NoMergeJoin(t mc) NoNestLoop(mc t ci) */ select count(*)
from title AS t
inner join movie_companies AS mc
on t.id = mc.movie_id AND t.kind_id > 2 AND t.production_year < 2012 AND mc.company_id > 73169 AND mc.company_type_id > 1
inner join cast_info AS ci
on t.id = ci.movie_id AND ci.role_id = 10;
